import React, { useState } from "react";
import "./style.css";

import Form from "../../components/Form";

export default function Home() {
  let d = new Date();
  let month = d.getMonth() + 1;
  let day = d.getDate();
  let year = d.getFullYear();
  let today = month + "|" + day + "|" + year;
  console.log(today);

  return (
    <div>
      <Form />
    </div>
  );
}
